import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fae6ff",
    borderWidth: 1,
    alignItems: "center",
    justifyContent: "center",
    padding: 20,
  },
  button: {
    margin: 10,
    width: 230,
    height: 50,
    backgroundColor: "#b800e6",
    alignItems: "center",
    justifyContent: "center",
  },
  text: {
    color: "#f5ccff",
    fontSize: 20,
  },
  title: {
    fontSize: 20,
    fontWeight: "bold",
  },
});

export default styles;
